// src/routes/AppRoutes.js
import { Routes, Route } from 'react-router-dom';
import UserList from '../components/CrudUser/UserList';
import AddUser from '../components/CrudUser/AddUser';
import EditUser from '../components/CrudUser/EditUser';
import Login from '../components/Page/Login';
import Register from '../components/Page/Register';
import AppLayout from '../components/Layout/AppLayout';
import Home from '../components/Page/home';

function AppRoutes() {
  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route element={<AppLayout />}>
        <Route path="/" element={<Home />} />
        <Route path="/users" element={<UserList />} />
        <Route path="/add" element={<AddUser />} />
        <Route path="/edit/:id" element={<EditUser />} />
        <Route path="/charts" element={<div>Charts Page</div>} />
        <Route path="/tables" element={<div>Tables Page</div>} />
        <Route path="/settings" element={<div>Settings Page</div>} />
      </Route>
    </Routes>
  );
}

export default AppRoutes;
